I'm glad to hear you're interested in compiler optimization! Here are a few popular techniques with simple examples:

1. **Constant Folding**: This technique replaces constant expressions with their values during compilation. It helps to reduce the number of operations at runtime.

   *Before optimization:*
   ```c
